import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import { Drawer, List, ListItem, ListItemIcon, ListItemText } from '@material-ui/core';
import { Home as HomeIcon, People as PeopleIcon, Info as InfoIcon } from '@material-ui/icons';
import './App.css'; // Import the CSS file for styling
import logo from './assets/logo.png'; // Import the logo image

import { makeStyles } from '@material-ui/core/styles';
import { Typography, Container, Box, AppBar, Toolbar, TextField, Button } from '@material-ui/core';

const HomePage = () => {
  const [isSidebarOpen, setIsSidebarOpen] = useState(false);

  const toggleSidebar = () => {
    setIsSidebarOpen(!isSidebarOpen);
  };

  const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
      backgroundImage: 'url("background-image.jpg")',
      backgroundSize: 'cover',
      backgroundPosition: 'center',
      backgroundRepeat: 'no-repeat',
      minHeight: '100vh',
    },
    header: {
      backgroundColor: 'transparent',
      boxShadow: 'none',
    },
    content: {
      marginTop: theme.spacing(8),
      marginBottom: theme.spacing(8),
      color: theme.palette.common.black, // Change the text color to black
      textAlign: 'center',
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      justifyContent: 'center',
      width: '100%',
      maxWidth: '100%',
      height: '100%',
      backgroundImage: 'url("https://www.arthmate.com/storage/homecontent/2023-01-06-63b80ebec878f.png")',
      backgroundSize: 'cover',
      backgroundPosition: 'center',
    },
    footer: {
      padding: theme.spacing(2),
      backgroundColor: theme.palette.grey[800],
      color: theme.palette.common.white,
      textAlign: 'center',
    },
    image: {
      width: 200,
      height: 200,
      borderRadius: '50%',
      objectFit: 'cover',
    },
    location: {
      marginTop: theme.spacing(2),
      marginBottom: theme.spacing(4),
    },
    form: {
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      width: '100%',
      maxWidth: 400,
      marginTop: theme.spacing(4),
    },
    input: {
      marginBottom: theme.spacing(2),
      width: '100%',
    },
  }));

  const classes = useStyles();

  const Introduction = () => {
    return (
      <div className={classes.root}>
        <AppBar position="static" className={classes.header}>
          <Toolbar>
            <Typography variant="h6">Arthmate</Typography>
          </Toolbar>
        </AppBar>
        <Container>
          <Box className={classes.content}>
            <Typography variant="h2">Introduction</Typography>
            <Typography variant="body1">
              Arthmate is India's premier embedded fintech platform leveraging technology to provide on-demand seamless deployment of credit across fintechs, digital platforms, and SME anchors. With our at-scale credit exchange platform, we strive to transform digital lending through proprietary tech and advanced analytics solutions.
            </Typography>
            <img className={classes.image} src="https://www.arthmate.com/storage/homecontent/2023-01-06-63b80ebec878f.png" alt="Introduction Image" />
          </Box>
        </Container>
        <footer className={classes.footer}>
          <Typography variant="body2" color="inherit">
            © {new Date().getFullYear()} Arthmate. All rights reserved.
          </Typography>
        </footer>
      </div>
    );
  };

  const Contact = () => {
    return (
      <div>
        <h2>Contact</h2>
        <form className={classes.form}>
          <TextField className={classes.input} label="Name" variant="outlined" />
          <TextField className={classes.input} label="Email" variant="outlined" />
          <TextField className={classes.input} label="Message" variant="outlined" multiline rows={4} />
          <Button variant="contained" color="primary">
            Submit
          </Button>
        </form>
      </div>
    );
  };

  const AppDrawer = () => {
    return (
      <Drawer anchor="left" open={isSidebarOpen} onClose={toggleSidebar}>
        <List>
          <ListItem button component={Link} to="/" onClick={toggleSidebar}>
            <ListItemIcon>
              <HomeIcon />
            </ListItemIcon>
            <ListItemText primary="Home" />
          </ListItem>
          <ListItem button component={Link} to="/contact" onClick={toggleSidebar}>
            <ListItemIcon>
              <PeopleIcon />
            </ListItemIcon>
            <ListItemText primary="Contact" />
          </ListItem>
          <ListItem button component={Link} to="/about" onClick={toggleSidebar}>
            <ListItemIcon>
              <InfoIcon />
            </ListItemIcon>
            <ListItemText primary="About" />
          </ListItem>
        </List>
      </Drawer>
    );
  };

  return (
    <Router>
      <div>
        <AppBar position="static" className={classes.header}>
          <Toolbar>
            <img src={logo} alt="Logo" className="logo" />
            <Typography variant="h6" className="title">
              Arthmate
            </Typography>
            <button className="menu-button" onClick={toggleSidebar}>
              Menu
            </button>
          </Toolbar>
        </AppBar>
        <AppDrawer />
        <Routes>
          <Route path="/" element={<Introduction />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/about" element={<h2>About</h2>} />
        </Routes>
      </div>
    </Router>
  );
};

export default HomePage;
